import React, { useEffect } from 'react'
import Item from '../Item/Item'
import { ProductsType, StateType } from '../../types/Types'
import Cart from '../Cart/Cart'
import Loading from '../Loading'
import { useSelector } from 'react-redux'
import { useAxios } from '../../Hooks/useAxios'

const Items = () => {
  const items = useSelector((state: StateType) => state.items)
  const loading = useSelector((state: StateType) => state.loading)
  const {fetchProducts} = useAxios()
  
  useEffect(()=> {fetchProducts()}, [loading])
  
  return (
    <>
      {loading ? <Loading />
        :
        <div>
          <Cart/>
          {items?.map((item: ProductsType) => <Item key={item.id} item={item} />)}
        </div>}
    </>
  )
}

export default Items
